pragma solidity ^0.4.8;

import "./ITimelineLib.sol";

/**
 * ITimelineLib implementation v1.0
 *
 * Copyright (c) 2017 Cognate, Inc.
 */
library TimelineLib {

    /**
     * Restriction modifier, restricts access of methods to the latest top level timeline in
     * the upgrade schema of the owning timeline
     */
    modifier onlyControllingOwner() {
        require(msg.sender == owned(owned(this).owner()).owner());
        _;
    }

    /**
     * If a contract has been upgraded, functions marked by this modifier are no
     * longer accessible
     */
    modifier notUpgraded() {
        require(!Timeline(this).upgraded());
        _;
    }

    function init(ITimelineLib.TimelineStorage storage self, Timeline previous) {
        self._interfaceID = 0x79056e9bb24f897d7f885dacdb2d506599944c0cdfd6b7495eb7f3ea624ac5af;
        self._upgraded = false;
        self._previous = previous;

        if(previous != address(0)) {
            self._next = previous.next();
            self._tail = previous.tail();
        }
    }

    function upgrade(ITimelineLib.TimelineStorage storage self, Timeline to) notUpgraded {
        self._upgraded = true;

        Timeline prev = self._previous;
        while(prev != address(0)) {
            prev.transferOwnershipTo(to);
            prev = prev.previous();
        }
    }

    function append(ITimelineLib.TimelineStorage storage self, TimelineDocument document) onlyControllingOwner notUpgraded {
        require(document.owner() == address(this));
        require(document.interfaceID() == self._interfaceID);

        // Append the document to this timeline
        if(self._next == address(0)) {
            self._next = document;
        } else {
            self._tail.setNext(document);
        }

        //document.setPrev(self._tail);
        self._tail = document;
    }

    function appendBytes(ITimelineLib.TimelineStorage storage self, bytes documentCode) onlyControllingOwner notUpgraded {
        append(self, TimelineDocument(IbaseLib.createContractFromBytes(documentCode)));
    }

    function callFunctionOf(address target, uint value, bytes data) onlyControllingOwner notUpgraded returns (bool) {
        // limit which functions can be called via callFunctionOf
        bytes32 calledFunctionSig;
        assembly {
            calledFunctionSig := mload(add(data, 32))
        }
        require(bytes4(calledFunctionSig) != 0xb2b2b44d); // prevent this function from calling setNext(address)
        //require(bytes4(calledFunctionSig) != 0xb2b2b44d); // prevent this function from calling setPrev(address)

        return target.call.value(value)(data);
    }

